.products {
  background: $white;
  margin-bottom: 32px;
  position: relative;

  &::before {
    content: " ";
    background: $vivid-orange;
    left: 0;
    height: 1890px;
    position: absolute;
    top: 0;
    width: 100%;
  }

  &__container {
    padding: 32px 12px 0;
  }
  &__info {
    margin-bottom: 32px;
    position: relative;
  }
  &__headline,
  &__paragraph {
    color: $white;
  }
  &__headline {
    color: white;
    display: inline-block;
    font-size: 28px;
    font-weight: 600;
    line-height: 32px;
    margin-bottom: 10px;
  }
  &__paragraph {
    font-weight: 400;
    max-width: 229px;
  }
  &__filter {
    margin-bottom: 32px;
    position: relative;
  }
  &__label {
    color: $white;
    display: block;
    font-size: 14px;
    line-height: 16px;
    margin-bottom: 8px;
  }
  &__select {
    background: rgba($strong-orange, 0.8);
    border: 0;
    color: $white;
    font-weight: 700;
    padding: 11px 12px;
    width: 100%;
  }

  &-group {
    margin-bottom: 28px;
  }

  &-card {
    margin-bottom: 12px;
    padding: 197px 12px 0;
    position: relative;

    &::before {
      background: $lightest-grey;
      content: " ";
      height: 251px;
      left: 0;
      position: absolute;
      top: 0;
      width: 100%;
    }
    &__photo {
      left: 50%;
      position: absolute;
      transform: translateX(-60%);
      z-index: 2;

      &--p1 {
        top: 77px;
        transform: translateX(-61%);
        width: 166px;
      }

      &--p2 {
        top: 65px;
        transform: translateX(-50%);
        width: 210px;
      }

      &--p3 {
        top: 24px;
        transform: translateX(-50%);
        width: 193px;
      }

      &--p4 {
        top: 50px;
        transform: translateX(-53%);
        width: 193px;
      }

      &--p5 {
        top: 28px;
        transform: translateX(-53%);
        width: 242px;
      }
    }
    &__description {
      background: $white;
      box-shadow: 0 0 30px #3d3f4015;
      padding: 38px 12px 58px;
      position: relative;
      z-index: 1;
    }
    &__headline {
      font-size: 18px;
      font-weight: 600;
      margin-bottom: 5px;
    }
    &__paragraph {
      margin-bottom: 18px;
    }
    &__label {
      display: block;
      font-size: 13px;
      line-height: 15px;
      font-weight: 400;
    }

    &__price {
      display: inline-block;
      font-size: 18px;
      font-weight: 700;
      line-height: 21px;
      margin-top: 3px;

      .sup {
        font-size: 15px;
        line-height: 18px;
        font-weight: 400;
        position: relative;
        top: -5px;
      }
    }

    &__buttons-group {
      bottom: 0;
      display: flex;
      left: 0;
      position: absolute;
      width: 100%;
    }
    &__button {
      flex: 1;
    }
  }

  &-button {
    background: $vivid-orange;
    color: $white;
    display: flex;
    justify-content: center;
    width: 168px;

    &__icon {
      margin-right: 14px;
      width: 14px;
    }
  }
}
